import React, {useState} from "react";


function useSignUp() {
  const [inputs, setInputs] = useState({})
  return (
    <form onSubmit={this.handleSubmit}>
      <label>
        Name:
        <input
          type="text"
          value={this.state.value}
          name="name"
          onChange={this.handleChange}
        />
        Email:
        <input
          type="text"
          value={this.state.value}
          name="email"
          onChange={this.handleChange}
        />
        Password:
        <input
          type="text"
          value={this.state.value}
          name="password"
          onChange={this.handleChange}
        />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );
}

export default useSignUp;
